import React, { useEffect, useState } from "react";

function App() {
  // Show login form or dashboard
  const [showLogin, setShowLogin] = useState(false);

  // Auth token and username state
  const [token, setToken] = useState(localStorage.getItem("token") || "");
  const [username, setUsername] = useState("");

  // Market data
  const [indices, setIndices] = useState([]);
  const [gainers, setGainers] = useState([]);

  // Notification from WebSocket (optional)
  const [notification, setNotification] = useState("");

  // Fetch market data
  useEffect(() => {
    fetch("http://localhost:8000/market/indices")
      .then((res) => res.json())
      .then((data) => setIndices(data.indices || []))
      .catch(() => setIndices([]));
    fetch("http://localhost:8000/market/top-gainers")
      .then((res) => res.json())
      .then((data) => setGainers(data || []))
      .catch(() => setGainers([]));
  }, []);

  // If authenticated, fetch user info and open WebSocket
  useEffect(() => {
    if (token) {
      fetchUser();
      const ws = new WebSocket("ws://localhost:8000/ws/notifications");
      ws.onmessage = (event) => setNotification(event.data);
      ws.onclose = () => console.log("WebSocket disconnected");
      return () => ws.close();
    }
  }, [token]);

  async function fetchUser() {
    try {
      const res = await fetch("http://localhost:8000/users/me", {
        headers: { Authorization: `Bearer ${token}` },
      });
      if (!res.ok) throw new Error();
      const data = await res.json();
      setUsername(data.username);
    } catch {
      setToken("");
      setUsername("");
      localStorage.removeItem("token");
    }
  }

  function handleLoginSuccess(newToken) {
    setToken(newToken);
    localStorage.setItem("token", newToken);
    setShowLogin(false);
  }

  function logout() {
    setToken("");
    setUsername("");
    localStorage.removeItem("token");
  }

  // Show login page only when showLogin is true
  if (showLogin && !token) {
    return (
      <Login
        onLoginSuccess={handleLoginSuccess}
        onCancel={() => setShowLogin(false)}
      />
    );
  }

  // Show dashboard with optional login/logout button
  return (
    <div className="min-h-screen bg-gray-50 flex flex-col">
      {/* Navbar */}
      <nav className="bg-gray-900 text-white p-4 flex justify-between items-center fixed w-full z-50">
        <h1 className="font-bold text-xl">USK BROKERING</h1>
        <div>
          {token ? (
            <div className="flex items-center space-x-4">
              <span>Welcome, {username}</span>
              <button
                onClick={logout}
                className="bg-red-600 px-3 py-1 rounded hover:bg-red-700 transition"
              >
                Logout
              </button>
            </div>
          ) : (
            <button
              onClick={() => setShowLogin(true)}
              className="bg-blue-600 px-4 py-2 rounded hover:bg-blue-700 transition"
            >
              Login
            </button>
          )}
        </div>
      </nav>

      <main className="pt-20 px-6 max-w-7xl mx-auto flex-grow w-full">
        <div className="bg-yellow-100 text-yellow-700 px-4 py-3 rounded mb-6">
          {notification || "No new notifications"}
        </div>

        <section className="bg-white rounded-xl shadow-lg p-12 mb-10 text-center">
          <h2 className="text-4xl font-bold text-blue-700 mb-4">
            Real-Time Trading Dashboard
          </h2>
          <p className="max-w-3xl mx-auto text-gray-700 mb-8">
            Professional trading platform with real-time market data, advanced
            order management, and comprehensive portfolio tracking.
          </p>
        </section>

        <section className="grid grid-cols-1 sm:grid-cols-4 gap-8 mb-12">
          <Feature
            icon="📈"
            title="Real-time Trading"
            description="Live quotes and rapid order execution."
          />
          <Feature
            icon="📊"
            title="Portfolio Analytics"
            description="Portfolio tracking with P&L analysis."
          />
          <Feature
            icon="🛡️"
            title="Risk Management"
            description="Advanced risk controls and monitoring."
          />
          <Feature
            icon="📱"
            title="Mobile Ready"
            description="Fully responsive on all devices."
          />
        </section>

        <section className="bg-gradient-to-r from-indigo-600 to-purple-700 rounded-xl p-8 text-white shadow-xl">
          <h3 className="text-xl font-bold mb-6 flex items-center">
            <span className="mr-3">📊</span>Market Overview
          </h3>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-10">
            <div>
              <h4 className="font-semibold mb-4">Popular Indices</h4>
              <ul>
                {indices.map((i) => (
                  <li
                    key={i}
                    className="flex justify-between border-b border-indigo-400 py-2 font-bold"
                  >
                    <span>{i}</span>
                    <span className="bg-green-500 px-3 py-1 rounded-full text-xs font-semibold">
                      Live
                    </span>
                  </li>
                ))}
              </ul>
            </div>
            <div>
              <h4 className="font-semibold mb-4">Top Gainers</h4>
              <ul>
                {gainers.map((g) => (
                  <li
                    key={g.symbol}
                    className="flex justify-between border-b border-indigo-400 py-2"
                  >
                    <span>{g.symbol}</span>
                    <span className="text-green-300 font-semibold">
                      {g.change}
                    </span>
                  </li>
                ))}
              </ul>
            </div>
          </div>
        </section>
      </main>
    </div>
  );
}

function Login({ onLoginSuccess, onCancel }) {
  const [form, setForm] = useState({ username: "", password: "" });
  const [error, setError] = useState("");

  async function handleLogin() {
    setError("");
    try {
      const res = await fetch("http://localhost:8000/login", {
        method: "POST",
        headers: { "Content-Type": "application/x-www-form-urlencoded" },
        body: new URLSearchParams(form),
      });
      if (!res.ok) throw new Error("Invalid credentials");
      const data = await res.json();
      onLoginSuccess(data.access_token);
    } catch (e) {
      setError(e.message);
    }
  }

  function onInputChange(e) {
    setForm({ ...form, [e.target.name]: e.target.value });
  }

  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-100 px-4">
      <div className="bg-white rounded shadow p-8 max-w-md w-full">
        <h2 className="text-2xl font-bold mb-6 text-center">Login</h2>
        {error && <p className="text-red-600 mb-4">{error}</p>}
        <input
          type="text"
          name="username"
          placeholder="Username"
          onChange={onInputChange}
          value={form.username}
          className="w-full border rounded px-3 py-2 mb-4"
        />
        <input
          type="password"
          name="password"
          placeholder="Password"
          onChange={onInputChange}
          value={form.password}
          className="w-full border rounded px-3 py-2 mb-6"
        />
        <div className="flex justify-between items-center">
          <button
            onClick={handleLogin}
            className="bg-blue-600 text-white px-6 py-2 rounded font-semibold hover:bg-blue-700 transition"
          >
            Login
          </button>
          <button
            onClick={onCancel}
            className="text-blue-600 underline hover:text-blue-800"
          >
            Cancel
          </button>
        </div>
      </div>
    </div>
  );
}

function Feature({ icon, title, description }) {
  return (
    <div className="bg-white rounded-xl p-6 shadow-md text-center space-y-4">
      <div className="text-5xl">{icon}</div>
      <h4 className="font-semibold text-lg">{title}</h4>
      <p className="text-gray-600 text-sm">{description}</p>
    </div>
  );
}

export default App;
